import Axios from 'axios';

export const YelpAPI = {
    search(cuisine) {
        {
            Axios({
              method: "GET",
              url: `http://localhost:5000/api/${cuisine}`
            }).then(res => {
                // setRestaurant(res);
              return res;
              }).catch(err => {
              console.log(err)
            });

          };
    }
}
